import React from 'react';
import './style.css';
import logo from '../../assets/images/logo_lowRes.PNG';

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function NavbarComponent() {
  return (
    <Navbar fixed="top" bg="white" expand="lg">
      <Container fluid>
        <Navbar.Brand href="#">
          <img src={logo} className="logo" alt="logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
          >
            <Nav.Link href="#userRegister">User Register</Nav.Link>
            <Nav.Link href="#adminLogin">Administrator Log In</Nav.Link>
            <Nav.Link href="#adminLogin">Home</Nav.Link>
            <Nav.Link href="#adminLogin">Test the Password</Nav.Link>
            <Nav.Link href="#adminLogin">Password Suggestions</Nav.Link>
            <Nav.Link href="#adminLogin">Contact Us</Nav.Link>
          </Nav>
          
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}

export default NavbarComponent;
